import './App.css';
import Home from './Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      <Button />
      <Router>
        <Routes>
          <Route exact path="/" component={Home} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
